mp;gt;&amp;lt;br style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;&amp;quot;&amp;gt;A learned lookup table mapping token IDs (from the tokenizer) to token embeddings. Embeddings are high-dimensional dense vectors which the model learns to associate with token IDs during training. The embeddings attempt to capture each token&amp;#39;s discrete meaning (which later layers will operate on and contextualize).&amp;amp;nbsp;How is this meaning represented in the embedding? A central tenet of mechanistic interpretability is that &amp;lt;a style=&amp;quot;font-size: 10px;&amp;quot; href=&amp;quot;https://distill.pub/2020/circuits/zoom-in/#claim-1&amp;quot;&amp;gt;meaningful features are represented by&amp;amp;nbsp;&amp;lt;i&amp;gt;directions&amp;lt;/i&amp;gt; in the embedding space&amp;lt;/a&amp;gt;. However, the&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;embedding space has&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;no privileged basis, so&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;amp;nbsp;individual components of the learned embeddings are not independently meaningful.&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; font-size: 9px;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 10px;&amp;quot;&amp;gt;For GPT-2 Small, the embedding space is 768-dimensional. This&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; font-size: 9px;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 10px;&amp;quot;&amp;gt;means that&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;\\(W_E\\), with its&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;50,257 vocabulary size,&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;comprises&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; text-align: center;&amp;quot;&amp;gt;38,597,376 parameters —&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;31% of the model&amp;#39;s total! (&amp;lt;a href=&amp;quot;https://jeremydolan.net/transformer-view/assets/parameter-allocation/&amp;quot;&amp;gt;The ratio drops for larger models&amp;lt;/a&amp;gt;).&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;html=1;align=center;verticalAlign=top;strokeColor=#23445d;fillColor=#bac8d3;fontSize=10;whiteSpace=wrap;spacingLeft=5;spacingRight=3;rounded=1;arcSize=10;shadow=1;perimeterSpacing=0;spacingBottom=0;spacing=0;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;551\&quot; y=\&quot;101\&quot; width=\&quot;343\&quot; height=\&quot;202\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;TIhiOplXk-bMIoN05m8u-10\&quot; value=\&quot;\&quot; style=\&quot;endArrow=block;html=1;rounded=0;exitX=0.454;exitY=0.987;exitDx=0;exitDy=0;exitPerimeter=0;entryX=0.804;entryY=0.015;entryDx=0;entryDy=0;entryPerimeter=0;edgeStyle=orthogonalEdgeStyle;endFill=1;endSize=4;\&quot; parent=\&quot;1\&quot; source=\&quot;RKJ8odA_8SBBd8osXSK1-1\&quot; target=\&quot;RKJ8odA_8SBBd8osXSK1-89\&quot; edge=\&quot;1\&qu &gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;SXs5o8TaVD6jqWYS2haX-7\&quot; value=\&quot; LayerNorm\\(^1\\)\&quot; style=\&quot;rounded=0;align=center;spacing=0;spacingTop=0;spacingLeft=0;fontSize=8;fillColor=#ffcccc;strokeColor=#36393d;whiteSpace=wrap;container=0;\&quot; parent=\&quot;O5vzstobPXcDMCcWYw32-4\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry y=\&quot;17\&quot; width=\&quot;50\&quot; height=\&quot;20\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxRectangle x=\&quot;124\&quot; y=\&quot;565\&quot; width=\&quot;70\&quot; height=\&quot;19\&quot; as=\&quot;alternateBounds\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;SXs5o8TaVD6jqWYS2haX-33\&quot; value=\&quot;$$W_{\\gamma}^{1}$$\&quot; style=\&quot;rounded=0;whiteSpace=wrap;fontSize=7;glass=0;gradientDirection=north;labelBackgroundColor=none;fillStyle=auto;strokeWidth=1;perimeterSpacing=0;fillColor=#bac8d3;strokeColor=#23445d;spacing=0;\&quot; parent=\&quot;O5vzstobPXcDMCcWYw32-4\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;8\&quot; width=\&quot;17\&quot; height=\&quot;17\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;SXs5o8TaVD6jqWYS2haX-34\&quot; value=\&quot;$$W_{\\beta}^{1}$$\&quot; style=\&quot;rounded=0;whiteSpace=wrap;fontSize=7;glass=0;gradientDirection=north;labelBackgroundColor=none;fillStyle=auto;strokeWidth=1;perimeterSpacing=0;fillColor=#bac8d3;strokeColor=#23445d;spacing=0;\&quot; parent=\&quot;O5vzstobPXcDMCcWYw32-4\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;25\&quot; width=\&quot;17\&quot; height=\&quot;17\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;Tf8dK1EDaYne_sqmPRFG-10\&quot; value=\&quot;\&quot; style=\&quot;shape=waypoint;sketch=0;fillStyle=solid;size=6;pointerEvents=1;points=[];fillColor=#f5f5f5;resizable=0;rotatable=0;perimeter=centerPerimeter;snapToPoint=1;strokeColor=#666666;fontColor=#333333;strokeWidth=1;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;294\&quot; y=\&quot;649\&quot; width=\&quot;20\&quot; height=\&quot;20\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;Tf8dK1EDaYne_sqmPRFG-11\&quot; style=\&quot;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;entryX=0.499;entryY=0.5;entryDx=0;entryDy=0;fillColor=#f5f5f5;strokeColor=#666666;endArrow=none;endFill=0;entryPerimeter=0;\&quot; parent=\&quot;1\&quot; source=\&quot;Tf8dK1EDaYne_sqmPRFG-10\&quot; target=\&quot;SXs5o8TaVD6jqWYS2haX-17\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxPoint x=\&quot;292\&quot; y=\&quot;549\&quot; as=\&quot;sourcePoint\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;O5vzstobPXcDMCcWYw32-42\&quot; value=\&quot;draft!\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontSize=23;fillColor=none;fontColor=#FF0000;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;771.96\&quot; y=\&quot;22\&quot; width=\&quot;60\&quot; height=\&quot;30\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;TIhiOplXk-bMIoN05m8u-19\&quot; value=\&quot;&amp;lt;b&amp;gt;Tokenizer&amp;lt;/b&amp;gt;&amp;lt;br style=&amp;quot;font-size: 9px;&amp;quot;&amp;gt;&amp;lt;div style=&amp;quot;text-align: left; line-height: 90%;&amp;quot;&amp;gt;&amp;lt;font size=&amp;quot;1&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left; line-height: 110%;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;Decomposes an input string into substring tokens based on a predefined dictionary, and outputs the index values for those tokens.&amp;amp;nbsp;The tokenizer is an input pre-processor, rather than part of the transformer architecture itself.&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left; line-height: 110%;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left; line-height: 110%;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;GPT-2 uses a &amp;lt;a href=&amp;quot;https://jeremydolan.net/transformer-view/assets/BPE_tokenization/&amp;quot;&amp;gt;BPE tokenizer&amp;lt;/a&amp;gt; with a&amp;amp;nbsp;vocabulary size&amp;amp;nbsp;of 50,257: all 256 byte values,&amp;amp;nbsp;&amp;lt;a href=&amp;quot;https://openaipublic.blob.core.windows.net/gpt-2/models/124M/vocab.bpe&amp;quot;&amp;gt;50,000 BPE&amp;amp;nbsp;merges&amp;lt;/a&amp;gt;, and a special&amp;amp;nbsp;&amp;lt;font face=&amp;quot;Courier New&amp;quot;&amp;gt;&amp;amp;lt;|endoftext|&amp;amp;gt;&amp;lt;/font&amp;gt;&amp;amp;nbsp;token. (Methods which display tokens &amp;lt;a href=&amp;quot;https://github.com/openai/gpt-2/blob/9b63575ef42771a015060c964af2c3da4cf7c8ab/src/encoder.py#L25&amp;quot;&amp;gt;replace&amp;lt;/a&amp;gt; control and whitespace characters with visible alternatives; thus the space,&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;U+0020, in our example input is shown a&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;s “Ġ”, U+0120.)&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;align=center;verticalAlign=top;strokeColor=#82b366;fillColor=#d5e8d4;fontSize=10;whiteSpace=wrap;spacingLeft=5;spacingRight=3;rounded=1;arcSize=10;spacing=0;spacingTop=0;shadow=1;html=1;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;265\&quot; y=\&quot;97\&quot; width=\&quot;263\&quot; height=\&quot;152\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;sjC_4Jn6D_5h_oFbE3Uh-1\&quot; value=\&quot;&amp;lt;p style=&amp;quot;line-height: 110%; font-size: 7px;&amp;quot;&amp;gt;Dimensions given and references to “GPT-2” are for GPT-2 Small (124 M)&amp;lt;br&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontColor=#0000FF;comic=0;fontSize=7;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;2.9350000000000023\&quot; y=\&quot;27\&quot; width=\&quot;84.63\&quot; height=\&quot;20\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;9rFQaaSsPFXTU5XIfM4L-9\&quot; style=\&quot;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;exitX=1;exitY=0.5;exitDx=0;exitDy=0;endArrow=block;endFill=1;startSize=6;endSize=4;fillColor=#cdeb8b;strokeColor=#000000;\&quot; parent=\&quot;1\&quot; source=\&quot;5a9QokkaWVo7pU32s1pD-6\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxPoint x=\&quot;616\&quot; y=\&quot;1117\&quot; as=\&quot;targetPoint\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;UserObject label=\&quot;&amp;lt;div style=&amp;quot;text-align: center;&amp;quot;&amp;gt;&amp;lt;b style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;Query, Key, Value&amp;lt;/b&amp;gt;&amp;lt;b style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;amp;nbsp;projections&amp;lt;/b&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;&amp;quot;&amp;gt;\\(n_{tokens}&amp;amp;nbsp;\\times d_{head}\\) = 3&amp;amp;nbsp;\\(\\times\\)&amp;amp;nbsp;64 (each)&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;The&amp;amp;nbsp;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;lower-dimensional (64)&amp;amp;nbsp; projection of each embedding for this attention head.&amp;lt;br&amp;gt;- projections selecting some subspace&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;- role of each Q/K/V...&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\&quot; tooltip=\&quot;\&quot; id=\&quot;5a9QokkaWVo7pU32s1pD-6\&quot;&gt;\n          &lt;mxCell style=\&quot;text;align=center;verticalAlign=top;fontSize=10;whiteSpace=wrap;spacingLeft=4;spacingRight=3;rounded=1;arcSize=10;shadow=1;spacing=0;html=1;fillColor=#cdeb8b;strokeColor=#36393d;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n            &lt;mxGeometry x=\&quot;375\&quot; y=\&quot;1078\&quot; width=\&quot;202\&quot; height=\&quot;104\&quot; as=\&quot;geometry\&quot; /&gt;\n          &lt;/mxCell&gt;\n        &lt;/UserObject&gt;\n        &lt;UserObject label=\&quot;&amp;lt;b&amp;gt;Residual stream&amp;lt;br&amp;gt;&amp;lt;/b&amp;gt;\\(n_{tokens}&amp;amp;nbsp;\\times d_{model}\\) = 3 \\(\\times\\) 768&amp;lt;br&amp;gt;(\\(d_{model}\\)-dimensional latent space)&amp;lt;div&amp;gt;&amp;lt;br&amp;gt;&amp;lt;div style=&amp;quot;line-height: 110%; text-align: left;&amp;quot;&amp;gt;Carries the input embeddings forward to each sublayer of the model, with each sublayer applying an “edit.”&amp;amp;nbsp;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;The r&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;text-align: center; background-color: initial;&amp;quot;&amp;gt;esidual stream is the&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;a href=&amp;quot;https://transformer-circuits.pub/2021/framework/#residual-comms&amp;quot;&amp;gt;central communication channel&amp;lt;/a&amp;gt; in a transformer; “&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; text-align: center;&amp;quot;&amp;gt;it doesn&amp;#39;t do any processing itself and all layers communicate through it” (and &amp;lt;i&amp;gt;only&amp;lt;/i&amp;gt;&amp;amp;nbsp;through it). E&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;ach attention and MLP sublayer “reads” in the residual stream (via a linear projection), performs some computation, and then “writes” some result back to the residual stream (via element-wise addition).&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;The residual stream is only modified by addition with these sublayer outputs; it is in essence a series of end-to-end skip connections.&amp;lt;br&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left; line-height: 110%;&amp;quot;&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;This linear, additive structure has several important consequences. First, during back propagation, addition preserves the full magnitude of the gradient. This allows the gradient to flow backwards through the residual stream to every layer&amp;amp;nbsp;during training, preventing “vanishing gradients” and making it feasible to train very deep models.&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;Second, during forward inference, the residual connections help prevent the&amp;amp;nbsp;input embeddings and early layer outputs from being&amp;amp;nbsp;overly degraded through repeated transformations. This means that the original embeddings, as well as early layer outputs, can generally be accessed by later sublayers. This persistence is enhanced by the use of subspaces: earlier sublayers can communicate to specific later sublayers (or even specific later attention heads) by&amp;amp;nbsp;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;“w&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;riting to&amp;amp;nbsp;&amp;lt;a href=&amp;quot;https://transformer-circuits.pub/2021/framework/#conceptual-take-aways&amp;quot;&amp;gt;different subspaces&amp;lt;/a&amp;gt;&amp;amp;nbsp;of the residual stream.”&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;A single attention head might “&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;a href=&amp;quot;https://transformer-circuits.pub/2021/framework/#subspaces-and-residual-stream-bandwidth&amp;quot;&amp;gt;send different information to different layers&amp;lt;/a&amp;gt; by storing it in different subspaces.”&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;[Due to the high dimensionality of the embedding space?] it appears that&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;“information persists in a subspace unless another layer actively deletes it.”&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;This persistence and the use of subspaces allows the model to optimize how information is pathed through the model. We can conceptualize transformers as implementing computational functions which correspond to particular paths: &amp;lt;i&amp;gt;e.g.&amp;lt;/i&amp;gt;, some function might go&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;from an attention head in layer 2, through an MLP in layer 5, to an attention head in layer 8, and so on. [cite NN]&amp;lt;/span&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;Each such path is free to use its own encoding.&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;All of these&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;encoded messages from one layer to another to another are&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;layered on top of another in the residual stream. This makes&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; text-align: center;&amp;quot;&amp;gt;the residual stream itself not a particularly tractable target for interpretability work. “&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; text-align: center;&amp;quot;&amp;gt;Rather than analyze the residual stream vectors, it can be helpful to &amp;lt;a href=&amp;quot;https://transformer-circuits.pub/2021/framework/#conceptual-take-aways&amp;quot;&amp;gt;decompose the residual stream into all these different communication channels&amp;lt;/a&amp;gt;, corresponding to paths through the model.”&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; text-align: center;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;div style=&amp;quot;line-height: 11px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;[Further difficulty for interpreting the residual stream: The residual stream can be seen as t&amp;lt;/span&amp;gt;he model&amp;#39;s shared, working memory. It is “&amp;lt;b&amp;gt;the only way that information can move between layers&amp;lt;/b&amp;gt;, and so the model needs to find a way to store all relevant information in there” (&amp;lt;a href=&amp;quot;https://dynalist.io/d/n2ZWtnoYHrU1s4vnFSAQ519J#z=DHp9vZ0h9lA9OCrzG2Y3rrzH&amp;quot;&amp;gt;NN&amp;lt;/a&amp;gt;) Ergo, under high demand, and expect it to exhibit significant &amp;lt;a href=&amp;quot;https://transformer-circuits.pub/2021/framework/#subspaces-and-residual-stream-bandwidth&amp;quot;&amp;gt;superposition&amp;lt;/a&amp;gt;.]&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;\&quot; tooltip=\&quot;\&quot; id=\&quot;SXs5o8TaVD6jqWYS2haX-17\&quot;&gt;\n          &lt;mxCell style=\&quot;text;align=center;verticalAlign=top;fontSize=10;whiteSpace=wrap;spacingLeft=5;spacingRight=5;rounded=1;arcSize=5;shadow=1;spacing=0;fillColor=#F0F0F0;fontColor=#333333;strokeColor=#666666;gradientColor=#BFBFBF;html=1;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n            &lt;mxGeometry x=\&quot;-94\&quot; y=\&quot;445\&quot; width=\&quot;366\&quot; height=\&quot;543\&quot; as=\&quot;geometry\&quot; /&gt;\n          &lt;/mxCell&gt;\n        &lt;/UserObject&gt;\n        &lt;UserObject label=\&quot;&amp;lt;b&amp;gt;Attention head&amp;lt;/b&amp;gt;&amp;lt;div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;After LayerNorm, vectors are processed in parallel by \\(n_{head}\\) attention heads (12, in GPT-2). Each head has its own set of QKV weight matrices, produces its own attention pattern, and&amp;lt;br&amp;gt;[VO]&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;Attention heads are the &amp;lt;i&amp;gt;only&amp;lt;/i&amp;gt;&amp;amp;nbsp;place in the entire architecture where information can move between tokens. (“&amp;lt;a href=&amp;quot;https://dynalist.io/d/n2ZWtnoYHrU1s4vnFSAQ519J#z=I74AgmPgkyj7w2ZXMTNL51nQ&amp;quot;&amp;gt;MLP layers, LayerNorm, Embedding, Positional Embedding, Unembed, cannot&amp;lt;/a&amp;gt;”)&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;\&quot; tooltip=\&quot;\&quot; id=\&quot;SXs5o8TaVD6jqWYS2haX-32\&quot;&gt;\n          &lt;mxCell style=\&quot;text;align=center;verticalAlign=top;strokeColor=#36393d;fillColor=#cdeb8b;fontSize=10;whiteSpace=wrap;spacingLeft=5;spacingRight=3;rounded=1;arcSize=10;shadow=1;spacing=0;html=1;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n            &lt;mxGeometry x=\&quot;699\&quot; y=\&quot;690\&quot; width=\&quot;228\&quot; height=\&quot;153\&quot; as=\&quot;geometry\&quot; /&gt;\n          &lt;/mxCell&gt;\n        &lt;/UserObject&gt;\n        &lt;mxCell id=\&quot;oTpKLrHSACD4qn84rfCT-1\&quot; value=\&quot;\&quot; style=\&quot;endArrow=none;html=1;rounded=0;flowAnimation=0;flowAnimationDuration=3000;endFill=0;endSize=4;jumpStyle=none;jumpSize=2;\&quot; parent=\&quot;1\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry width=\&quot;50\&quot; height=\&quot;50\&quot; relative=\&quot;1\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxPoint x=\&quot;641\&quot; y=\&quot;903\&quot; as=\&quot;sourcePoint\&quot; /&gt;\n            &lt;mxPoint x=\&quot;641\&quot; y=\&quot;926\&quot; as=\&quot;targetPoint\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;oTpKLrHSACD4qn84rfCT-7\&quot; value=\&quot;&amp;lt;font style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;\\(\\tim aX-26\&quot; value=\&quot;&amp;lt;div&amp;gt;Transforms each input vector independently to have mean 0 and variance 1, then scales and shifts each component \\(i\\) of the now-normalized vector by&amp;amp;nbsp;a learned scaling factor (\\(\\gamma_{i}\\)) and shifting factor (&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;\\(\\beta_{i}\\)&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;). &amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;(Each LayerNorm layer \\(n\\) has a \\(d_{model}\\)-length&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;amp;nbsp;\\(W_{\\gamma}^n\\) and&amp;amp;nbsp;\\(W_{\\beta}^n\\) which is applied component-wise.)&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;br&amp;gt;&amp;lt;b&amp;gt;Purpose&amp;lt;/b&amp;gt;:&amp;amp;nbsp;The initial normalization promotes consistent distributions of input to a layer by reducing “covariate shift” &amp;lt;a href=&amp;quot;https://arxiv.org/abs/1607.06450&amp;quot; style=&amp;quot;&amp;quot;&amp;gt;(Ba et al., 2016)&amp;lt;/a&amp;gt;,&amp;amp;nbsp;thereby&amp;amp;nbsp;stabilizing gradients and speeding up training. The parameterized scale and shift then return some flexibility to the model, allowing it to optimize the transformation for each layer.&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;b&amp;gt;Implications&amp;lt;/b&amp;gt;:&amp;amp;nbsp;In GPT-2, LayerNorm&amp;amp;nbsp;mediates every “read” of the residual stream (&amp;lt;i&amp;gt;i.e.&amp;lt;/i&amp;gt;, at the start of each attention or MLP sublayer, and before Unembed). Because LayerNorm is a&amp;amp;nbsp;non-linear transformation,&amp;amp;nbsp;it complicates interpretability, which &amp;lt;a href=&amp;quot;https://youtu.be/ll0oduwDEwI?t=3171&amp;quot;&amp;gt;prominent researchers&amp;lt;/a&amp;gt;&amp;amp;nbsp;have &amp;lt;a href=&amp;quot;https://youtu.be/bOYE6E8JrtU?t=3525&amp;quot;&amp;gt;expressed frustration about&amp;lt;/a&amp;gt;.&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;div&amp;gt;In principle, the non-linearity in LayerNorm can perform useful computation, and it can even work as a general-purpose activation function. In practice within LLM architectures, it is an open question whether LayerNorm performs any “meaningful” computation or if it is merely an artifact of the training process.&amp;amp;nbsp;Attempts have been made to train more interpretable models without LayerNorm, and &amp;lt;a href=&amp;quot;https://www.arxiv.org/abs/2409.13710&amp;quot; style=&amp;quot;&amp;quot;&amp;gt;a recent preprint&amp;lt;/a&amp;gt;&amp;amp;nbsp;claims to have removed GPT-2&amp;#39;s LayerNorm layers with fine-tuning with only minor performance degradation, suggesting it does not play a crucial role&amp;amp;nbsp;at inference time.&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;align=left;verticalAlign=top;whiteSpace=wrap;fontSize=10;html=1;spacingLeft=3;spacingRight=3;\&quot; parent=\&quot;SXs5o8TaVD6jqWYS2haX-19\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry y=\&quot;23\&quot; width=\&quot;358\&quot; height=\&quot;261\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;9rFQaaSsPFXTU5XIfM4L-8\&quot; style=\&quot;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;exitX=1;exitY=0.5;exitDx=0;exitDy=0;endArrow=oval;endFill=1;entryX=0.5;entryY=1;entryDx=0;entryDy=0;fillColor=#cdeb8b;strokeColor=#000000;\&quot; parent=\&quot;1\&quot; source=\&quot;cyDdZTLPUWvgE6DJaVXe-9\&quot; target=\&quot;m0Mtf9fCQ5Iv8dhjtq92-1\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxPoint x=\&quot;603\&quot; y=\&quot;972\&quot; as=\&quot;targetPoint\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;UserObject label=\&quot;&amp;lt;b&amp;gt;Query, Key, Value matrices&amp;lt;br&amp;gt;&amp;lt;/b&amp;gt;\\(d_{model}&amp;amp;nbsp;\\times d_{head}\\) = 768 \\(\\times\\) 64 (each)&amp;lt;br&amp;gt;&amp;lt;br&amp;gt;&amp;lt;div style=&amp;quot;text-align: left; line-height: 110%;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 10px;&amp;quot;&amp;gt;Each attention head in each attention sublayer has its own Query, Key, and Value matrix. (In practice they are stored in a single matrix for efficiency, but in principle — Each vector from the residual stream is (after LayerNorm) multiplied by each of these matrices, to form three lower-dimensional projections.&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left; line-height: 110%;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\&quot; tooltip=\&quot;\&quot; id=\&quot;cyDdZTLPUWvgE6DJaVXe-9\&quot;&gt;\n          &lt;mxCell style=\&quot;text;align=center;verticalAlign=top;fontSize=10;whiteSpace=wrap;spacingLeft=4;spacingRight=3;rounded=1;arcSize=10;shadow=1;spacing=0;html=1;fillColor=#cdeb8b;strokeColor=#36393d;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n            &lt;mxGeometry x=\&quot;394\&quot; y=\&quot;914\&quot; width=\&quot;166.41\&quot; height=\&quot;153\&quot; as=\&quot;geometry\&quot; /&gt;\n          &lt;/mxCell&gt;\n        &lt;/UserObject&gt;\n        &lt;mxCell id=\&quot;cyDdZTLPUWvgE6DJaVXe-26\&quot; style=\&quot;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;strokeColor=#000000;fontColor=#1A1A1A;endArrow=none;endFill=0;endSize=2;\&quot; parent=\&quot;1\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxPoint x=\&quot;630.5\&quot; y=\&quot;1420\&quot; as=\&quot;targetPoint\&quot; /&gt;\n            &lt;mxPoint x=\&quot;630.5\&quot; y=\&quot;1305\&quot; as=\&quot;sourcePoint\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;cyDdZTLPUWvgE6DJaVXe-13\&quot; value=\&quot;\\(1\\)\&quot; style=\&quot;text;align=center;verticalAlign=middle;rounded=0;strokeColor=#36393d;fillColor=#eeeeee;fontFamily=Helvetica;fontStyle=0;html=1;spacing=0;whiteSpace=wrap;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;621\&quot; y=\&quot;1364\&quot; width=\&quot;19\&quot; height=\&quot;18\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;cyDdZTLPUWvgE6DJaVXe-16\&quot; style=\&quot;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;exitX=0.25;exitY=0;exitDx=0;exitDy=0;fillColor=#cce5ff;strokeColor=#36393d;\&quot; parent=\&quot;1\&quot; source=\&quot;cyDdZTLPUWvgE6DJaVXe-17\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxPoint x=\&quot;313.75\&quot; y=\&quot;1735\&quot; as=\&quot;targetPoint\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;cyDdZTLPUWvgE6DJaVXe-17\&quot; value=\&quot;&amp;lt;div style=&amp;quot;line-height: 100%;&amp;quot;&amp;gt;branch for&amp;amp;nbsp;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;first&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;line-height: 100%;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;MLP&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;amp;nbsp;sublayer&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;comic=0;fontSize=8;fontStyle=0;arcSize=0;fillColor=#eeeeee;strokeColor=#36393d;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;310\&quot; y=\&quot;1759\&quot; width=\&quot;72\&quot; height=\&quot;28\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;cyDdZTLPUWvgE6DJaVXe-20\&quot; value=\&quot;\&quot; style=\&quot;endArrow=none;html=1;rounded=0;flowAnimation=0;flowAnimationDuration=3000;endFill=0;endSize=4;jumpStyle=gap;jumpSize=2;\&quot; parent=\&quot;1\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry width=\&quot;50\&quot; height=\&quot;50\&quot; relative=\&quot;1\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxPoint x=\&quot;308\&quot; y=\&quot;1730\&quot; as=\&quot;sourcePoint\&quot; /&gt;\n            &lt;mxPoint x=\&quot;793\&quot; y=\&quot;1753\&quot; as=\&quot;targetPoint\&quot; /&gt;\n            &lt;Array as=\&quot;points\&quot;&gt;\n              &lt;mxPoint x=\&quot;793\&quot; y=\&quot;1730\&quot; /&gt;\n            &lt;/Array&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;BkbPcNTal3Uyudf2zEf_-17\&quot; style=\&quot;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;strokeColor=default;strokeWidth=1;align=center;verticalAlign=middle;fontFamily=Helvetica;fontSize=11;fontColor=default;labelBackgroundColor=default;startSize=6;endArrow=block;endFill=1;endSize=4;\&quot; parent=\&quot;1\&quot; source=\&quot;cyDdZTLPUWvgE6DJaVXe-29\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxPoint x=\&quot;613\&quot; y=\&quot;1374\&quot; as=\&quot;targetPoint\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;UserObject label=\&quot;&amp;lt;b&amp;gt;Attention scores&amp;lt;/b&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;Collectively, the “attention pattern.”&amp;amp;nbsp;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;These scores, normalized by softmax, will be the weights used to calculate the weighted sum&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\&quot; tooltip=\&quot;\&quot; id=\&quot;cyDdZTLPUWvgE6DJaVXe-29\&quot;&gt;\n          &lt;mxCell style=\&quot;text;align=center;verticalAlign=top;fontSize=10;whiteSpace=wrap;spacingLeft=4;spacingRight=3;rounded=1;arcSize=10;shadow=1;spacing=0;html=1;fillColor=#cdeb8b;strokeColor=#36393d;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n            &lt;mxGeometry x=\&quot;374.2\&quot; y=\&quot;1362\&quot; width=\&quot;206\&quot; height=\&quot;68\&quot; as=\&quot;geometry\&quot; /&gt;\n          &lt;/mxCell&gt;\n        &lt;/UserObject&gt;\n        &lt;mxCell id=\&quot;oTpKLrHSACD4qn84rfCT-8\&quot; value=\&quot;\&quot; style=\&quot;endArrow=none;html=1;rounded=0;flowAnimation=0;flowAnimationDuration=3000;endFill=0;endSize=4;jumpStyle=none;jumpSize=2;\&quot; parent=\&quot;1\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry width=\&quot;50\&quot; height=\&quot;50\&quot; relative=\&quot;1\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxPoint x=\&quot;721\&quot; y=\&quot;903\&quot; as=\&quot;sourcePoint\&quot; /&gt;\n            &lt;mxPoint x=\&quot;721\&quot; y=\&quot;926\&quot; as=\&quot;targetPoint\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;UserObject label=\&quot;&amp;lt;font style=&amp;quot;font-size: 10px;&amp;quot;&amp;gt;&amp;lt;b style=&amp;quot;&amp;quot;&amp;gt;Positional embedding weight matrix&amp;lt;br&amp;gt;&amp;lt;/b&amp;gt;\\(n_{context} \\times d_{model}\\) = 1,024 \\(\\times\\) 768&amp;lt;br&amp;gt;&amp;lt;div style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;A learned lookup table mapping sequence positions to positional encodings. A challenge for the transformer architecture is that it is “order invariant”:&amp;amp;nbsp;although the token embeddings superficially appear to be stored in order, this ordering is not exposed to any of the model&amp;#39;s computation. But for language, order matters.&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;There are many approaches to adding position information (absolute or relative)&amp;amp;nbsp; to the token embeddings (or directly to the attention calculation). GPT-2 simply parameterizes it, allowing the model itself to figure out for itself how to represent sequence order. Each row \\(i\\) of \\(W_{P}\\) contains a learned “time signal” that is added to token embedding \\(i\\), thereby marking its position.&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;This means that the size of this matrix must be defined at training time, thereby fixing the maximum sequence length (“context length”) that the model can process: 1,024 for GPT-2.&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\&quot; tooltip=\&quot;\&quot; id=\&quot;cKd76CsvtHgX21CRy6J_-17\&quot;&gt;\n          &lt;mxCell style=\&quot;text;html=1;align=center;verticalAlign=top;strokeColor=#23445d;fillColor=#bac8d3;fontSize=10;whiteSpace=wrap;spacingLeft=5;spacingRight=3;rounded=1;arcSize=10;shadow=1;spacing=0;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n            &lt;mxGeometry x=\&quot;466\&quot; y=\&quot;316\&quot; width=\&quot;366\&quot; height=\&quot;194\&quot; as=\&quot;geometry\&quot; /&gt;\n          &lt;/mxCell&gt;\n        &lt;/UserObject&gt;\n        &lt;mxCell id=\&quot;BkbPcNTal3Uyudf2zEf_-14\&quot; value=\&quot;\\(0.98\\)\&quot; style=\&quot;text;align=center;verticalAlign=middle;rounded=0;strokeColor=#36393d;fillColor=#eeeeee;fontFamily=Helvetica;fontStyle=0;fontSize=6;html=1;spacing=0;whiteSpace=wrap;\&q ot;1\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxPoint x=\&quot;678\&quot; y=\&quot;1435\&quot; as=\&quot;sourcePoint\&quot; /&gt;\n            &lt;Array as=\&quot;points\&quot;&gt;\n              &lt;mxPoint x=\&quot;678\&quot; y=\&quot;1614\&quot; /&gt;\n            &lt;/Array&gt;\n            &lt;mxPoint x=\&quot;316\&quot; y=\&quot;1614\&quot; as=\&quot;targetPoint\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;UserObject label=\&quot;&amp;lt;b&amp;gt;Output weight matrix&amp;lt;/b&amp;gt;&amp;lt;br&amp;gt;For attention layer 1, head 1&amp;lt;br&amp;gt;\\(d_{head} \\times d_{model}\\) = 64 \\(\\times\\) 768&amp;lt;br&amp;gt;&amp;lt;div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/b&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;Embeds the weighted-sum of the value projections for each token back to embedding space.&amp;lt;br&amp;gt;&amp;lt;br&amp;gt;&amp;lt;b&amp;gt;NB:&amp;amp;nbsp;&amp;lt;/b&amp;gt;This is typically implemented as a per-layer transformation rather than a per-head transformation,&amp;amp;nbsp;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;for computational efficiency.&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;by taking the weighted-sum projection for each token position from each head (each a \\(d_head\\)-dimensional vector), concatenating them to make a \\(d_model\\)-dimensional vector, and then transforming this concatenation all at once with \\(W^1_O\\). Here, we take \\(d_head\\)-sized slices of \\(W_O^1\\) for each head. This is mathematically equivalent and provides a per-head output embedding that can be a locus of interpretation.&amp;lt;/span&amp;gt;&amp
